import './markers.css';
import {useState} from 'react'

function Markers() {

  const [markerState, setMarkerState] = useState({
      markers: []
  })


  useEffect(() => {
      fetch('/api/markers')
      .then(res => res.json())
      .then(markers => 
        setMarkerState({ markers }, () => console.log('Markers fetched:')))

      return () => {
           console.log("unmounted")
      }
  }, [])
  return (
    <div className="Markers">
     <h1> Markers</h1>
    </div>
  );
}

export default Markers;
